import { TITLE } from './types'

 const initialState = {
   title: "123",
 }

export const titleReducer = (state, action) => {
  console.log('reducer>', action)
  console.log('VALUE HERE', action.payload)
  switch (action.type) {
    case TITLE:
      return {
        ...state,
        title: state.title,
      }
    default:
      return state
  }
}
